import React from 'react';
import './nav-inter.css'; // Estilo CSS para a barra de navegação
import logo from './imgs/logo_site.png';

function Navbar() {
  return (
    <nav className='nav'>
      <div className="marca">
        <img src={logo} className='marca-image' alt="Logo" />
        <a href='#' className='nav__brand'>DataVerse</a>
      </div>
    </nav>
  );
}

export default Navbar;
